        <Flex>
            <Flex bg={'white'} p={'5'} direction={'column'} flex={7}>
                <Heading>TITLE</Heading>
                <HStack>
                    <Text>Nguyen Khanh Duy</Text>
                    <Text>10 -1 -2012</Text>
                </HStack>
                <Text>DESCIPFDFHD</Text>
            </Flex>
            <Box w={'20px'}></Box>
            <Flex bg={'white'} p={'5'} direction={'column'} justifyContent={'space-between'} flex={3}>
                <Flex justifyContent={"space-between"}>
                    <Text>Status</Text>
                    <Text>Not Complete</Text>

                </Flex>
                <Box w={'100%'}>
                    <Button colorScheme={'blue'} w={'100%'}>Start</Button>
                </Box>
            </Flex>
        </Flex>
    );
};

export default AssignedInfo;
